package com.pranay.GeeksForGeeks;

public class Check {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Check p = new Check();
		p.start();
	}

	private void start() {
		// TODO Auto-generated method stub
		boolean b1 = false;
		boolean b2 = fix(b1);
		System.out.println(b1+" "+b2);
	}

	private boolean fix(boolean b1) {
		// TODO Auto-generated method stub
		b1 = true;
		return b1;
	}

}
